(defn chart
  [data]
  (let [males (filter #(and (= :male (:class %))
                            (= (:class %) (:result %))) (:data data))
        females (filter #(and (= :female (:class %))
                            (= (:class %) (:result %))) (:data data))
        mmissed (filter #(and (= :male (:class %))
                             (= :female (:result %))) (:data data))
        fmissed (filter #(and (= :female (:class %))
                             (= :male (:result %))) (:data data))]
    (println (:summary data))
    (compose (list-plot (map :datum (:data data)) :opacity 0.1 :colour "white")
             (list-plot (map :datum males) :colour "blue" :symbol-size 5)
             (list-plot (map :datum females) :colour "red" :symbol-size 5)
             (list-plot (map :datum mmissed) :colour "green" :symbol-size 25)
             (list-plot (map :datum fmissed) :colour "yellow" :symbol-size 25))))
